if(typeof(usig)=="undefined"){usig={}}usig.Punto=function(b,a){this.x=this.lon=b;this.y=this.lat=a;this.getX=function(){return this.x};this.getY=function(){return this.y};this.toJson=function(){return'{ "x":'+this.x+', "y": '+this.y+" }"};this.toString=function(){return"("+this.x+", "+this.y+")"}};usig.Punto.fromWkt=function(b){var c=/^POINT *\((-?[0-9]+\.[0-9]+) (-?[0-9]+\.[0-9]+)\)$/;var a=null;if(resMatch=b.match(c)){a=new usig.Punto(resMatch[1],resMatch[2])}return a};usig.Punto.fromPunto=function(a){return new usig.Punto(a.getX(),a.getY())};usig.Punto.fromObj=function(a){return new usig.Punto(a.x,a.y)};usig.Punto.fromArray=function(a){return new usig.Punto(a[0],a[1])};